// src/App.js

import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './pages/Home';
import HealthNavbar from './components/Navbar';
import Footer from './components/footer'; // Importando o componente Footer
import LoginPaciente from './pages/LoginPaciente'; // Importando a nova página
import LoginMedico from './pages/LoginMedico';
import LoginAdmin from './pages/LoginAdmin';
import DashboardPaciente from './pages/DashboardPaciente';
import DashboardMedico from './pages/DashboardMedico';
import MarcarConsulta from './pages/MarcarConsulta';
import AdminDashboard from './pages/AdminDashboard';
import CadastroMedicoAdmin from './pages/CadastroMedicoAdmin';
import CadastroPacienteAdmin from './pages/CadastroPacienteAdmin';
import MarcarConsultaAdmin from './pages/MarcarConsultaAdmin';

function App() {
  const { isDarkMode } = useTheme(); // Use o contexto do tema

  return (
    <Router>
      <div className={`app ${isDarkMode ? 'dark-mode' : 'light-mode'}`}>
        <HealthNavbar />
        {/* Adicione o botão de alternância no Navbar ou onde preferir */}
        <ThemeToggle /> 
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/loginPaciente" element={<LoginPaciente />} /> {/* Adicionando a rota para LoginPaciente */}
          <Route path="/loginMedico" element={<LoginMedico />} />
          <Route path="/loginAdmin" element={<LoginAdmin />} />
          <Route path="/dashboardPaciente" element={<DashboardPaciente />} />
          <Route path="/dashboardMedico" element={<DashboardMedico />} />
          <Route path="/marcarConsulta" element={<MarcarConsulta />} />
          <Route path="/adminDashboard" element={<AdminDashboard />} />
          <Route path="/cadastroMedico" element={<CadastroMedicoAdmin />} />
          <Route path="/cadastroPaciente" element={<CadastroPacienteAdmin />} />
          <Route path="/marcarConsultaAdmin" element={<MarcarConsultaAdmin />} />
        </Routes>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
